import React from "react";
import GoogleMap from "react-google-maps"
import dotenv from "dotenv"

dotenv.config();

const Map = () => {
    return (
        <div className="map">
            <GoogleMap
                bootstrapURLKeys={{key: process.env.REACT_APP_GOOGLE_API_KEY, }}
                defaultZoom={15}
                defaultCenter={{lat: 37.5, lng: 127}}>
            </GoogleMap>
        </div>
    );
}

export default Map;
